import {tryLogIn, trySignUp} from './../../redux/reducers/usersR';
import React from 'react';

const RegistrationPage = (props)=>{


  let logIn = ()=>{
    props.dispatch(tryLogIn())
  }

  return (
    <div className={s.registrationPage}>
      <div className={s.loginBlock}>
        <div className={s.nameOfBlock}> Log in</div>
        <div className={s.username} ref={log_username}><input placeHolder="username" type="text" /></div>
        <div className={s.password} ref={log_password}><input placeHolder="password" type="text" /></div>
        <div><button>Log in</button></div>
      </div>
      <hr />
      <div className={s.signUpBlock}>
        <div className={s.nameOfBlock}>Sign up</div>
        <div className={s.username} ref={log_username}><input placeHolder="username" type="text" /></div>
        <div className={s.email} ref={sg_email}><input placeHolder="email" type="text" /></div>
        <div className={s.password} ref={sg_password}><input placeHolder="password" type="text" /></div>
        <div><button>Sign up</button></div>
      </div>
    </div>
  );
};

export default RegistrationPage;
